// qtimes are generated by mathematica
long double normdenom( long double q0, long double q1, long double q2, long double q3, long double omega0, long double omega1, long double omega2, long double time) {
	return (pow(q2 + 0.5*time*(omega2*(q3 + 0.25*(omega0*q0 + omega1*q1 + omega2*q2)*time) + omega1*(-q0 - 0.25*(-(omega2*q1) + omega1*q2 + omega0*q3)*time) + omega0*(q1 + 0.25*(omega2*q0 - omega0*q2 + omega1*q3)*time)),2) + pow(q1 + 0.5*time*(omega1*(q3 + 0.25*(omega0*q0 + omega1*q1 + omega2*q2)*time) + omega2*(q0 + 0.25*(-(omega2*q1) + omega1*q2 + omega0*q3)*time) + omega0*(-q2 - 0.25*(-(omega1*q0) + omega0*q1 + omega2*q3)*time)),2) + pow(q0 + 0.5*time*(omega0*(q3 + 0.25*(omega0*q0 + omega1*q1 + omega2*q2)*time) + omega2*(-q1 - 0.25*(omega2*q0 - omega0*q2 + omega1*q3)*time) + omega1*(q2 + 0.25*(-(omega1*q0) + omega0*q1 + omega2*q3)*time)),2) + pow(q3 + 0.5*time*(omega0*(q0 + 0.25*(-(omega2*q1) + omega1*q2 + omega0*q3)*time) + omega1*(q1 + 0.25*(omega2*q0 - omega0*q2 + omega1*q3)*time) + omega2*(q2 + 0.25*(-(omega1*q0) + omega0*q1 + omega2*q3)*time)),2));
} 

